import React from 'react';
import {Card} from 'react-bootstrap';
import {Button} from 'react-bootstrap';
import Logo from './logo.PNG';
// Om oss, component i Landing.js, skal fortelle litt om oss, skal deretter følge en knapp for registrering med google

const OmApp = () => {
    return(
      <div className="text-white text-center">
      <div className="container d-flex align-items-center flex-column pt-5">
        
          <img className="rounded-circle " src={Logo} alt="" />
  
          <h1 className="masthead-heading text-uppercase mb-0">Start Bootstrap</h1>
      
          <div className="divider-custom divider-light">
              <div className="divider-custom-line"></div>
              <div className="divider-custom-icon"><i className="fas fa-star"></i></div>
              <div className="divider-custom-line"></div>
          </div>
    
          <p className="masthead-subheading font-weight-light mb-0">Graphic Artist - Web Designer - Illustrator</p>
      </div>
  </div>
    );
};
export default OmApp;
